      <div className="col-6 ">
        <div class="card bg-secondary ">
          <div class="card-body text-warning ">
            <h5 class="card-title">imiÄ™: {name} nazwisko: {surname}</h5>
          </div>
        </div>
      </div>
  );
}

export default Frame;
